$(document).ready(function() {
	$('.menu-toggle').on('click', function() {
		$(this).toggleClass('is-active');
		$('#header-menu').toggleClass('visible');
	});
	$('.dropdown-list>.dropdown>a').on('click', function(e) {
		e.preventDefault();
		e.stopPropagation();
		return false;
	});
	$('.post').on({
		mouseenter: function() { $(this).addClass('active') },
		mouseleave: function() { $(this).removeClass('active') }
	});
	__.bindAnything();
});

var __ = {};
__.bindAnything = function() {
	if($('.slider .slider--double').length) {
		$('.slider .slider--double').each(function() {
			var slider = this;
			var min = parseInt($(slider).attr('data-min'));
			var max = parseInt($(slider).attr('data-max'));
			var start = parseInt($(slider).attr('data-start'));
			var end = parseInt($(slider).attr('data-end'));
			var pips = parseInt($(slider).attr('data-pips'));
			noUiSlider.create(slider, {
				start: [ start, end ],
				connect: true,
				range: { min: min, max: max },
				pips: pips 
				? 	{ mode: 'count', values: pips, density: pips, format: {
			    	  to: function (value) { return value.toString().replace(/\B(?=(\d{3})+(?!\d))/g, " "); }
				    } 
				} 
				: false
			});
			var from_input = $(slider).closest('.slider').find('input.from');
			var to_input = $(slider).closest('.slider').find('input.to');
			slider.noUiSlider.on('update', function(values, handle) {
				var value = values[handle];
				if(handle) to_input.val(Math.round(value));
				else from_input.val(Math.round(value));
			});
			from_input.on('change', function() {
				slider.noUiSlider.set([this.value, null]);
			});
			to_input.on('change', function() {
				slider.noUiSlider.set([null, this.value]);
			});		
		});
	}
	if($('.games-list--triggers').length) {
		$('.games-list--triggers a[data-tab]').on('click', function() {
			var button = $(this);
			var tab_id = button.attr('data-tab');
			var togglable = button.attr('data-togglable') != 'undefined' ? button.attr('data-togglable') : true;
			var container = $('.games-list--wrapper');
			var new_tab = $('.games-list--tab[data-tab="'+tab_id+'"]');
			var active_tab = $('.games-list--tab.active');
			if(!button.parent().hasClass('active')) {
				container.show().siblings().hide();
				active_tab.addClass('inactive');
				setTimeout(function() { active_tab.removeClass('inactive') }, 900);
				button.parent().addClass('active').siblings().removeClass('active');
				new_tab.addClass('active').siblings().removeClass('active');
			} else if(togglable == 'true') {
				button.parent().removeClass('active').siblings().removeClass('active');
				active_tab.addClass('inactive');
				setTimeout(function() { 
					active_tab.removeClass('inactive').removeClass('active');
					container.hide().siblings().show();
				}, 900);
			}
		});
	}	

	if($('.inactive-toggle').length) {
		$('.inactive-toggle').on('click', function() {
			$(this).closest('.inactive-toggable').toggleClass('inactive');
		});
	}

	if($('.list-group-item').length) {
	    $('.list-group-item').on('click',function(e) { 
	     	$(this).addClass('active').siblings().removeClass('active'); 
	   	});
	}
	if($('.filter--header').length) {
		$('.filter--header').on('click', function(e) {
			$(this).next('.filter--body').slideToggle(150);
		});
	}
		if($('.comments--block').length) {
			$('.comments--block').find('.show').on('click', function() {
				var ctext = $(this).text();
				var ntext = $(this).attr('data-reverse-text');
				$(this).text(ntext).attr('data-reverse-text', ctext);
				$(this).closest('.item').toggleClass('open');
			});
			$('.comments--block').find('.reply').on('click', function() {
				var comments = $('.comments--block .item');
				var comment = $(this).closest('.item');
				if(comment.hasClass('new-reply')) {
					comment.removeClass('new-reply');
				} else {
					comments.removeClass('new-reply');
					comment.addClass('new-reply');
				}
			});
		}

}